function Header(props) {
  return (
    <div>
      <div className="app-title">
      <h1>Book App</h1>
      </div>
      <div className="nav-bar">
        <button>Home</button>
        <button>Books</button>
        <button>About</button>
      </div>
    </div>
  );
}
function Book(props) {
  return (
    <div className="page-container">
    <div className="container">
        <h1>{props.title}</h1>
        <div className="sub-container">

      <img src={props.image} alt="book" />
      <p>{props.description }</p>
        </div>
    </div>
    </div>
  );
} export default Book
